import React from 'react';
import { NavLink } from 'react-router-dom';

const Header = () => (
  <header>
    <h1>Budget</h1>gg
    <NavLink to="/" activeClassName="is-active" exact={true}>
      Dashboard{' '}
    </NavLink>
    <NavLink to="/create" activeClassName="is-active">
      Create Expense{' '}
    </NavLink>
  </header>
);

export default Header;
